Jacques Demy's auspicious debut; &quot;a musical without music&quot; set in the port city
of Nantes.

Lola, a cabaret singer awaiting the return of Michel, her long-absent lover
and the father of her child. In Michel's absence, Lola is being courted by
her childhood friend Roland and American sailor Frankie. At some point, it
seems that Lola will settle down with one of them, but her heart still
belongs to Michel.

